//суперсила "Алохомора" - открывается случайная пара карт
import { showTooltip } from "../../utils/tooltip";
import styles from "./Superpowers.module.css";

export function AlohomoraPower({ setPowerInfo, onMouseEnter, onMouseLeave }) {
  const handleMouseOver = () => {
    showTooltip("AlohomoraPower", "Здесь можете добавить вашу подсказку для AlohomoraPower");
  };

  return (
    <div className={styles.superpowerContainer} onMouseOver={handleMouseOver}>
      <img
        className={styles.superpowerIcon}
        src="../power-alohomora.svg"
        alt="Суперсила алохомора"
        onMouseEnter={e => showTooltip(e.target, "Alohomora Power Tooltip")}
      />
    </div>
  );
}
